import React from "react";
import "./styles.css";

export default function App() {
  return Article();
}

function Article() {
  return (<article className="article">
<h2 className="article__title">Life aaah finds a Way</h2>
<label id="react"></label>
<input id="react"><a href="Jurassicpark.com" className="article__link"></a></input>
  </article>);
}
